" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 510px\">",
"   <div class=\"ttl\">",
"    Generation of the P wave",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 490px; height: 277px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    With normal sinus rhythm, the atrial depolarization vector is directed from the right atrium to the left atrium and downward towards the AV junction (arrow). As a result, the P wave will normally be upright in lead II and negative in lead aVR.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
