"   <div class=\"cntnt\" style=\"width: 466px; height: 598px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The Stroop Color&nbsp;Word&nbsp;Interference Test examines the ability to direct attention. After first confirming that the subject can appropriately read the color names and name the colors (top two panels), he/she is asked to name the color of the ink that the&nbsp;word is printed in (third panel). As an example, the patient should say for the first row of the third panel \"Blue, Green, Blue, Blue, Red, Green.\" The test is scored based on speed and accuracy.",
