" <div class=\"graphic2\" style=\"width: 1173px;\">",
"  <div class=\"figure\" style=\"width: 603px\">",
"   <div class=\"ttl\">",
"    Malignant and benign gastric ulcer as seen on upper gastrointestinal (UGI) series",
