"   </div>",
"   <div class=\"lgnd\">",
"    Double contrast upper GI study demonstrates a large barium-filled ulcer crater (arrow) surrounded by edematous mucosa. The ulcer is extending from the stomach, across the pylorus and into the duodenum, features that are not seen with benign ulcers.",
"    <div class=\"footnotes\">",
"    </div>",
