" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    High and low dose oral vancomycin are equally effective in acute C. difficile colitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 353px; height: 372px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Disappearance of diarrhea was identical in patients with acute clostridium difficile colitis who received either high (500 mg four times daily, red line) or low (125 mg four times daily, blue line) dose oral vancomycin for 10 days.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from Fekety, R, Silva, J, Kaufman, C, et al. Am J Med 1989; 86:15.",
"    </div>",
